import React from "react";

const Footer = () => (
  <div>
    <footer
      className="page-footer font-small"
      style={{ height: 40, color: "white" }}
    >
      <div className="footer-copyright text-center py-2">
        Copyright Jaime Zepeda 2019
      </div>
    </footer>
  </div>
);

export default Footer;
